import React, { useState } from 'react';
import { ReactTinyLink } from 'react-tiny-link';

const EnhancedLinkPreview = () => {
  const [hasError, setHasError] = useState(false);

  return (
    <div>
      {hasError ? (
        <div>Failed to load link preview.</div>
      ) : (
        <ReactTinyLink 
          url="https://jindal.utdallas.edu/news/finhack-2024-challenges-and-encourages-ut-dallas-students/"
          cardSize="large"
          showGraphic={true}
          maxLine={4}
          minLine={1}
          onError={(error) => {
            console.error('Error loading link preview:', error);
            setHasError(true);
          }}
        />
      )}
    </div>
  );
};

export default EnhancedLinkPreview;
